import { Fragment, useState } from "react";
import "./App.css";
import FormInput from "./components/FormInput";
function App() {
  const [currentdata, setcurrentdata] = useState("");
  const userData = (username, userage, useremail, userphn) => {
    setcurrentdata({
      name: { username },
      age: { userage },
      email: { useremail },
      phone: { userphn },
    });
  };
  return (
    <Fragment>
      <FormInput onAdduser={userData} />;
    </Fragment>
  );
}

export default App;
